/* assume 2 <= n <= 0x40000000 */
int count=0;
void great_swap(int* pa,int* pb)
{
    int ab=*pa^*pb;
    int c=n[count];
    c&=ab;
    *pa^=c;
    *pb^=c;
    count++;
}

void crypto_sort_int32(int32 *array,size_t n)
{
  size_t top,p,q,r,i,j;
  int32 *x = array;

  top = 1;
  while (top < n - top) top += top;

  for (p = top;p >= 1;p >>= 1) {
    i = 0;
    while (i + 2 * p <= n) {
      for (j = i;j < i + p;++j) {
        great_swap(&x[j],&x[j+p]);
      }
      i += 2 * p;
    }
    for (j = i;j < n - p;++j) {
      great_swap(&x[j],&x[j+p]);
    }

    i = 0;
    j = 0;
    for (q = top;q > p;q >>= 1) {
      if (j != i) {
        for (;;) {
          if (j == n - q) goto done;
          int32 a = x[j + p];
          for (r = q;r > p;r >>= 1) {
            great_swap(&a,&x[j + r]);
          }
          x[j + p] = a;
          ++j;
          if (j == i + p) {
            i += 2 * p;
            break;
          }
        }
      }
      while (i + p <= n - q) {
        for (j = i;j < i + p;++j) {
          int32 a = x[j + p];
          for (r = q;r > p;r >>= 1) {
            great_swap(&a,&x[j+r]);
          }
          x[j + p] = a;
        }
        i += 2 * p;
      }
      /* now i + p > n - q */
      j = i;
      while (j < n - q) {
        int32 a = x[j + p];
        for (r = q;r > p;r >>= 1) {
          great_swap(&a,&x[j+r]);
        }
        x[j + p] = a;
        ++j;
      }

      done: ;
    }
  }
}


int sample(int* a, int d,int N,char * ans)
{
    int i=0;
    int tmp[256];
    for(i=0;i<d+1;++i)
    {
        tmp[i]=(a[i]<<3)|1;
    }
    for(i=d+1;i<2*d+1;++i)
    {
        tmp[i]=(a[i]<<3)|2;
    }
    for(i=2*d+1;i<N;++i)
    {
        tmp[i]=(a[i]<<3);
    }
    
    crypto_sort_int32(tmp,N);
    for(i=0;i<N;++i)
    {
        ans[i]=tmp[i]&3;
    }
    return 0;
}    


